  }, [_vm._ssrNode("<h1 id=\"contrast\"><a href=\"#contrast\" class=\"header-anchor\">#</a> Contrast</h1> <p>The third major topic in mapping is something known as <strong>contrast</strong>.</p> <h2 id=\"definition\"><a href=\"#definition\" class=\"header-anchor\">#</a> Definition</h2> <p>Contrast can be defined as: <strong>the idea that varying sections within a song should play different relative to each other</strong>. In fact, the concept of contrast builds off of what you learned about emphasis. In addition to emphasis, contrast takes into consideration one more factor: <em>rhythm density</em></p> <h3 id=\"rhythm-density\"><a href=\"#rhythm-density\" class=\"header-anchor\">#</a> Rhythm Density</h3> <p>If you recall earlier, you read about what rhythm is, which is the arrangement of circles, sliders, and spinners to represent the song. Rhythm density talks about <em>how many</em> circles, sliders, and spinners are used to represent the song, or sections of a song.</p> <p><em>How many</em> is rather a simple idea. Five circles in a row or one slider that spans the length of same five circles, which would be &quot;easier&quot; to play? In 99.9% of the cases, one slider would be easier because there are less objects to click (one compared to five). That's the idea of rhythm density.</p> <h2 id=\"creating-good-contrast\"><a href=\"#creating-good-contrast\" class=\"header-anchor\">#</a> Creating Good Contrast</h2> <p>Generally speaking, calmer sections of the music should have less emphasis and be less <em>rhythmically</em> dense than more intense sections of the music, and more intense sections of the music should have more emphasis and be more rhythmically dense than the calmer sections.</p> <p>Suppose you kept a map's fundamentals constant throughout the entire map, meaning that the entire maps' rhythms are roughly equal in all sections in density, the emphasis for everything is constant. It just would not be a good map. From a mapping standpoint, the map should reflect what is happening within the map, but if everything within the map is held constant, then it would be a poor representation of the song. Creating good contrast in a map is extremely important, and cannot be neglected when beatmapping.</p>")]);
