ing\" class=\"header-anchor\">#</a> Proper Difficulty Scaling</h2> <p>Properly scaling each difficulty depends on one main factor: context. The star rating of a map should never be taken into consideration when judging how well your mapset's spread progression. Since we don't have <em>the</em> star rating calculation, it will not judge many things properly.</p> <p>Take a look at the difficulty in question you want to map after it (like if you want to map an insane, take a look at the hard). Understand the rhythm that the difficulty is using and understand the type of emphasis used and how much. Use your judgement to now appropriately scale the difficulty and map accordingly. Ask yourself, <em>who is the target audience, and can they reasonably jump from the previous difficulty to the next one?</em> If the answer is no, evaluate why and adjust.</p> <p>As a last resort, try asking the target audience if they can testplay your difficulty if you aren't sure at all and gather their opinions.</p>")]);
